	add("sheath", "{\"term\":\"sheath\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027sheth\u0027 from Old english (ca. 450-1100) {{m|ang|scēaþ}}, from Proto-germanic {{m|gem-pro|*skaiþiz}}, possibly from a root \u0027skaiþ-\u0027 (\u0026quot;split, divide\u0026quot;), related to {{m|gem-pro|*skaiþaną||separate}}. Cognate with Dutch \u0027schede\u0027 Low German \u0027scheed\u0027 German \u0027scheide\u0027 Danish \u0027skede\u0027 Norwegian \u0027skjede\u0027 Icelandic \u0027skeið\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scabbard; a holster for a sword\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything that has a similar shape to a scabbard for a sword that is for the purpose of holding an object that is longer than it is wide; a case\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The insulating outer cover of an electrical cable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A tight-fitting dress\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A condom\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The foreskin of certain animals, e.g. dogs and horses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The base of a leaf when sheathing or investing a stem or branch, as in grasses\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One of the elytra of an insect\", \"priority\":8}]}, \"synonyms\":{}}");

