	add("sheeple", "{\"term\":\"sheeple\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|sheep|people|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"People who unquestioningly accept as true whatever their political leaders say or who adopt popular opinion as their own without scrutiny\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 Sept. 11, Glen Justice and John Files, \u0026quot;[http://www.nytimes.com/2005/09/11/nyregion/11cnd-walk.html?pagewanted\u003dprint\u0026amp;_r\u003d0 Commemoration or Promotion? Walk Highlights Iraq Divide],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 21 Aug 2014)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"War protesters . . . did appear along Mr. Rumsfeld\u0027s path carrying signs saying \u0026quot;Bush is a Liar\u0026quot; and \u0026quot;Wake Up, \u0027\u0027Sheeple\u0027\u0027\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 Aug. 27, Aaron Wherry, \u0026quot;[http://www.macleans.ca/authors/aaron-wherry/the-commons-you-bore-us-mr-ignatieff/ The Commons: You bore us, Mr. Ignatieff],\u0026quot; \u0027Macleans\u0027 (Canada) \u0026lt;small\u0026gt;(retrieved 21 Aug 2014)\u0026lt;/small\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"F]ormer MP Garth Turner’s new book . . . is entitled \u0027\u0027\u0027Sheeple\u0027\u0027\u0027, a term apparently applied to people who often take on the characteristics—curly white hair covering most of the body, fondness for grazing, tendency to do as told—of sheep\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 Aug. 20, Richard Adams, \u0026quot;[http://www.theguardian.com/world/richard-adams-blog/2010/aug/20/far-right-conspiracy-theories?CMP\u003dtwt_gu The American far-right\u0027s top 10 paranoid conspiracy theories (photo caption)],\u0026quot; \u0027Guardian\u0027 (UK) \u0026lt;small\u0026gt;(retrieved 21 Aug 2014)\u0026lt;/small\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Harmless vapour trails left by planes? That\u0027s what they want you to think, \u0027\u0027sheeple\", \"priority\":7}]}, \"synonyms\":{}}");

	add("sheepmeat", "{\"term\":\"sheepmeat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|sheep|meat|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The meat of a sheep, used as food; mutton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Tam Dalyell, \u0026quot;[http://books.google.com/books?id\u003da5CS6IcW0FEC\u0026amp;pg\u003dPA59\u0026amp;dq\u003d%22sheepmeat%22 Castles in the air]\u0026quot;, \u0027New Scientist\u0027, 17 July 1986\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I do not know what will be the outcome of the argument about levels of radioactive caesium in \u0027\u0027sheepmeat\u0027\u0027 (alias mutton or lamb) in North Wales and Cumbria, let alone in Scotland\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Julian Roche, \u0027The International Wool Trade\u0027, Woodhead Publishing (1995), ISBN 1855731916, [http://books.google.com/books?id\u003dFjPMSe1oOJIC\u0026amp;pg\u003dPA114 page 114\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Wool and \u0027\u0027sheepmeat\u0027\u0027 combined form New Zealand\u0027s largest export industry: wool on its own is the fourth largest\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Jennifer M. Ames \u0026amp; Michelle M. Sutherland, \u0026quot;Effect of Castration and Slaughter Age on The Flavor of Sheepmeat\u0026quot;, in \u0027Quality Attributes of Muscle Foods\u0027 (eds. Youling L. Xiong, Chi-Tang Ho, \u0026amp; Fereidoon Shahidi), Kluwer Academic/Plenum Publishers (1999), ISBN 9780306461163, [http://books.google.com/books?id\u003dCJkwZgau1UkC\u0026amp;pg\u003dPA148 page 148\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"However, the full effects of castration on \u0027\u0027sheepmeat\u0027\u0027 flavor remain unclear and other factors, including age at slaughter, also need to be considered\", \"priority\":7}]}, \"synonyms\":{}}");

