	add("shelf", "{\"term\":\"shelf\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Probably from Old english (ca. 450-1100) {{m|ang|scylfe||deck of a ship}}; distantly related to \u0027\u0027 \u0027\u0027 and \u0027\u0027 Cognate to Dutch {{m|nl|schelf}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat, rigid, rectangular structure, fixed at right angles to a wall, and used to support, store or display objects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 October 31, David M. Halbfinger, \u0026quot;[http://www.nytimes.com/2012/11/01/nyregion/new-jersey-continues-to-cope-with-hurricane-sandy.html?hp],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 31 October 2012)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Localities across New Jersey imposed curfews to prevent looting. In Monmouth, Ocean and other counties, people waited for hours for gasoline at the few stations that had electricity. Supermarket \u0027\u0027shelves\u0027\u0027 were stripped bare\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The capacity of such an object; as, a shelf of videos\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A projecting ledge that resembles such an object\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A reef, shoal or sandbar\", \"priority\":6}]}, \"synonyms\":{}}");

