	add("shelter", "{\"term\":\"shelter\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|sheltron}}, {{m|enm|sheldtrume||roof or wall formed by locked shields}}, from Old english (ca. 450-1100) {{m|ang|scildtruma}}, {{m|ang|scyldtruma||a phalanx, company (of troops), a tortoise, a covering, shed, shelter|lit\u003dshield-troop}}, from {{m|ang|scyld}}, {{m|ang|scield||shield}} + {{m|ang|truma||a troop of soldiers}}. Cognate with Scots {{m|sco|schilthrum}}, {{m|sco|schiltrum}}. More at {{l/en|shield}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A refuge, haven or other cover or protection from something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An institution that provides temporary housing for homeless people, battered women etc\", \"priority\":2}]}, \"synonyms\":{}}");

